import React from "react";

function CardInfo(props){
    return(
    <div style={{maxWidth:'100%' ,maxHeight:'100%'}} className="col-md-4 col-sm-6 border">
<div style={{maxWidth:'100%' ,maxHeight:'100%'}} className="card bg-dark text-white" id="div1">
    <div style={{maxWidth:'100%' ,maxHeight:'100%'}} className="card-header">
        <img style={{maxWidth:'100%' ,maxHeight:'100%'}} src={this.props.img} alt="member"/>
</div>

<div   className="card-body" style={{backgroundColor: this.props.email ? 'black' : 'white'}}>
<h1 style={{maxWidth:'100%' ,maxHeight:'100%'}}> Name : {this.props.name}</h1>
<p style={{maxWidth:'100%' ,maxHeight:'100%'}}>position : {this.props.position}</p>
<p style={{maxWidth:'100%' ,maxHeight:'100%'}}>phone : {this.props.pohne}</p>
<p style={{maxWidth:'100%' ,maxHeight:'100%'}}>email : {this.props.email}</p></div>


</div>
</div>
    
    );
}
export default CardInfo
